    false,nt"url": null,nt"notes": "An aerial photograph is a photograph of
    the earth's surface taken with a camera mounted in an airplane. The geographic extent
    of this scanned, georectified, and mosaiced 3.4-meter pixel resolution black and
    white digital aerial photograph is approximately the Idaho Department of Water Resources
    Adminstrative Basin 27. 14 tiles acquired as part of the 1964/1966 Adminstrative
    Basin 27 Air Photo Project are included in this mosaic. The collection includes
    some of Bingham and Caribou counties. The 1:20,000-scale black and white aerial
    photography used in the production of this mosaiced image was flown in 1964 and
    1966 by the Farm Service Administration.",nt"license_title": null,nt"extras":
